import React from "react";

const ProjectInvolves = () => {
  return (
    <div>
      <h4>The project involves:</h4>
      <label className="discuss-project-container">
        Web Software &#38; websites <input type="checkbox" />
        <span className="checkmark"></span>
      </label>
      <label className="discuss-project-container">
        Redesign of existing site &#38; websites <input type="checkbox" />
        <span className="checkmark"></span>
      </label>
    </div>
  );
};

export default ProjectInvolves;
